<!DOCTYPE html>

<head>
  <meta charset="UTF-8">
  <meta http-equiv=“X-UA-Compatible” content=“chrome=1″ />
  <meta name="description" content="網路傳輸時間計算">

  <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">
  <title>網路傳輸時間計算</title>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/babel-polyfill/7.8.3/polyfill.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/vue/dist/vue.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/element-ui/2.13.0/index.js"></script>
  <link href="https://cdnjs.cloudflare.com/ajax/libs/element-ui/2.13.0/theme-chalk/index.css" rel="stylesheet">
  <script src="https://cdnjs.cloudflare.com/ajax/libs/element-ui/2.13.0/locale/zh-TW.min.js"></script>
  <script>
    ELEMENT.locale(ELEMENT.lang.zhTW);
  </script>
  <script src="https://code.jquery.com/jquery-3.4.1.slim.min.js"></script>

  <script src="  https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.12.1/js/all.min.js"></script>


</head>

<body>
  <div id="transferTime">
    <el-container>
      <el-header>
        <el-row>
          <el-col :span="24">
            <div class="grid-content center-block titleStyle" style="font-size: 26pt; font-weight: bold;">網路傳輸時間計算</div>
          </el-col>
          <el-row>
      </el-header>
      <el-main>
        <el-row>
          <el-col :span="6">
            <div class="grid-content bg-purple" style="text-align: center;"></div>
          </el-col>
          <el-col :span="6">
            <div class="grid-content bg-purple-light" style="text-align: center;"></div>
          </el-col>
          <el-col :span="6">
            <div class="grid-content bg-purple" style="text-align: center;"></div>
          </el-col>
          <el-col :span="6">
            <div class="grid-content bg-purple-light" style="text-align: center;"></div>
          </el-col>
        </el-row>


        <el-row :gutter="10">

          <el-col :span="6">
            <div class="grid-content bg-purple">
              <el-input autosize v-model="bit">
                <template slot="prepend">檔案大小</template>
                <el-select autosize slot="append" v-model="volume" @change="currentSel">
                  <el-option v-for="item in storage" :key="item" :label="item" :value="item">
                  </el-option>
                </el-select>
              </el-input>
            </div>
          </el-col>

          <el-col :span="6">
            <div class="grid-content bg-purple-light" style="text-align: center;"></div>
          </el-col>

		  	<el-col :span="6">
            <label>封包損耗(%)：</label>
            <el-input-number v-model="lostPacket" :min="50" :max="100"></el-input-number>
            <el-popover placement="top-start" title="封包損耗" trigger="hover" content="傳輸時有Ethernet Header, IP Header, TCP Header,ATM Header等損耗，雖然是byte等級的佔用，
            但我無法確認適不適用於目前的網路環境，預設90%">
              <el-button slot="reference">預設90%說明</el-button>
            </el-popover>
          </el-col>
    <!--      <el-col :span="6" class="shadow">
            <div class="grid-content">
              <i class="fas fa-cloud-download-alt"></i>(實際)下載時間:{{actualDownload}}
            </div>
            <div class="grid-content">
              <i class="fas fa-cloud-upload-alt"></i>(實際)上傳時間:{{actualUpload}}
            </div>
          </el-col>
          <el-col :span="6" class="shadow">
            <div class="grid-content bg-purple-light ">
              <i class="fas fa-download"></i>(理論)下載時間:{{targetDownload}}
            </div>
            <div class="grid-content bg-purple-light">
              <i class="fas fa-upload"></i>(理論)上傳時間:{{targetUpload}}
            </div>
          </el-col> -->
        </el-row>
        <el-row :gutter="10">
          <el-col :span="6">
            <div class="grid-content bg-purple" style="text-align: center;">
              <el-input autosize v-model="dnByte">
                <template slot="prepend">下載頻寬</template>
                <template slot="append">Mbps</template>
              </el-input>
            </div>
          </el-col>

          <el-col :span="6">
            <div class="grid-content bg-purple-light" style="text-align: center;">
              <el-input autosize v-model="upByte">
                <template slot="prepend">上傳頻寬</template>
                <template slot="append">Mbps</template>
              </el-input>
            </div>
          </el-col>
          <el-col :span="6">
            <div class="grid-content bg-purple">

            </div>
          </el-col>
          <el-col :span="6">
            <div class="grid-content bg-purple-light">
            </div>
          </el-col>
        </el-row>

        <el-row :gutter="10">
          <el-col :span="6">
            <div class="grid-content bg-purple" style="text-align: center;">
              <el-input autosize v-model="dnbit">
                <template slot="prepend">下載速度</template>
                <template slot="append">MB/s</template>
              </el-input>
            </div>
          </el-col>

          <el-col :span="6">
            <div class="grid-content bg-purple-light" style="text-align: center;">
              <el-input autosize v-model="upbit">
                <template slot="prepend">上傳速度</template>
                <template slot="append">MB/s</template>
              </el-input>
            </div>
          </el-col>
        </el-row>
		
		 <el-row :gutter="10">
		  <el-col :span="6" class="shadow">
            <div class="grid-content">
              <i class="fas fa-cloud-download-alt"></i>(實際)下載時間:{{actualDownload}}
            </div>
			 <div class="grid-content bg-purple-light ">
              <i class="fas fa-download"></i>(理論)下載時間:{{targetDownload}}
            </div>

          </el-col>
          <el-col :span="6" class="shadow">
                       <div class="grid-content">
              <i class="fas fa-cloud-upload-alt"></i>(實際)上傳時間:{{actualUpload}}
            </div>
            <div class="grid-content bg-purple-light">
              <i class="fas fa-upload"></i>(理論)上傳時間:{{targetUpload}}
            </div>
          </el-col>
		 </el-row>
        <el-row></el-row>
   <!--     <el-row>
          <el-col :span="24">
            <label>封包損耗(%)：</label>
            <el-input-number v-model="lostPacket" :min="50" :max="100"></el-input-number>
            <el-popover placement="top-start" title="封包損耗" trigger="hover" content="傳輸時有Ethernet Header, IP Header, TCP Header,ATM Header等損耗，雖然是byte等級的佔用，
            但我無法確認適不適用於目前的網路環境，預設90%">
              <el-button slot="reference">預設90%說明</el-button>
            </el-popover>
          </el-col>
        </el-row> -->
		以下單位都是使用Mbps
        <el-divider><i class="fas fa-angle-double-left"></i>固定網路<i class="fas fa-angle-double-right"></i></el-divider>
        <el-row>
          <el-col :span="4" v-for="button in fixed">
            <el-button type="primary" plain v-on:click="setValue(button.down, button.up)" >{{button.type}}<br /> {{button.down}}／{{button.up}}</el-button>
          </el-col>
        </el-row>
                <el-divider><i class="fas fa-angle-double-left"></i>行動網路(僅能參考用)<i class="fas fa-angle-double-right"></i></el-divider>
         <el-row> 
           <el-col :span="4" v-for="button in generation"> 
            <el-button type="primary" plain v-on:click="setValue(button.down, button.up)" >{{button.type}}<br /> {{button.down}}／{{button.up}}</el-button> 
           </el-col> 
         </el-row> 
        <el-main>
          <el-footer>
        <el-row>
          <el-col :span="24">
            <div class="grid-content center-block footerStyle" style="font-size: 26pt; font-weight: bold;"> </div>
          </el-col>
          <el-row>
          </el-footer>
    </el-container>
  </div>
